  render(){
    return (
      <div>
        <Navbar dark color="primary">
          <div className="container">
          <NavbarBrand href="/">Ristorante Con Fusion</NavbarBrand>
          </div>
        </Navbar>
        <Menu dishes={this.state.dishes}/>
      </div>
    )
  }
}

